-- in : prof            profession of the attacker
-- out: (image index shown on attacker, image index shown on defender)
function title_dir:GetSkillSpec(prof)
	local jihe1={1,2,3,13,14,15}
	local jihe2={4,5,6,16,17,18}
	local jihe3={7,8,9,19,20,21}
	local jihe4={10,11,12,22,23,24}
	local jihe5={64,65,66,67,68,69}
	local i
	for i=1,6 do
		if (prof==jihe1[i])	then
			return 0,1 ;
		end
		if (prof==jihe2[i]) then
			return 0,2;
		end
		if (prof==jihe3[i]) then
			return 0,3;
		end
		if (prof==jihe4[i]) then
			return 4,0;
		end
		if (prof==jihe5[i]) then
			return 0,5;
		end
	end
	return 0,0;
end
		
function title_dir:GetBabySkillSpec(prof)
	local jihe1= 2;
	local jihe2= 4;
	local jihe3= 8;
	local jihe4= 16;
	local jihe5= 64;
	local i
	if (prof==jihe1)	then
		return 0,1 ;
	end
	if (prof==jihe2) then
		return 0,2;
	end
	if (prof==jihe3) then
		return 0,3;
	end
	if (prof==jihe4) then
		return 4,0;
	end
	if (prof==jihe5) then
		return 0,5;
	end
	return 0,0;
end




































































































































































